import collections
import functools
import time


def shortest(N, edgeList):
    t1 = time.time()
    edgeList.sort()
    graph = collections.defaultdict(set)
    weight = [[float("inf")] * N for _ in range(N)]
    for i, j, w in edgeList:
        if weight[i][j] < float("inf"): continue
        graph[i].add(j)
        weight[i][j] = min(weight[i][j], w)
    res = float("inf")
    visited = [0] * N
    nodeCost = [float("inf")] * N
    nodeCost[0] = 0

    @functools.lru_cache(None)
    def dfs(curNode: int, curCost: int):
        nonlocal res
        if curCost > res: return
        if curNode == N - 1:
            res = curCost
            return
        for nextNode in graph[curNode]:
            if not visited[nextNode] and curCost + weight[curNode][nextNode] < nodeCost[nextNode]:
                nodeCost[nextNode] = curCost + weight[curNode][nextNode]
                visited[nextNode] = 1
                dfs(nextNode, curCost + weight[curNode][nextNode])
                visited[nextNode] = 0

    dfs(0, 0)
    print(time.time() - t1)
    return res != float("inf") and res or -1


